CREATE TABLE IF NOT EXISTS fut15_players (
  id int(11) NOT NULL AUTO_INCREMENT,
  baseId int(11) NOT NULL,
  resourceId int(20) NOT NULL,
  First_Name varchar(255) CHARACTER SET utf8 NOT NULL,
  Last_Name varchar(255) CHARACTER SET utf8 NOT NULL,
  Common_Name varchar(255) DEFAULT NULL,
  Rating int(2) NOT NULL,
  Rare enum('0','1') NOT NULL,
  Foot varchar(5) NOT NULL,
  Height int(3) NOT NULL,
  Date_Of_Birth varchar(10) NOT NULL,
  ClubId int(11) NOT NULL,
  NationId int(11) NOT NULL,
  LeagueId int(11) NOT NULL,
  Attribute1 int(2) NOT NULL,
  Attribute2 int(2) NOT NULL,
  Attribute3 int(2) NOT NULL,
  Attribute4 int(2) NOT NULL,
  Attribute5 int(2) NOT NULL,
  Attribute6 int(2) NOT NULL,
  PRIMARY KEY (id)
);

